import React, { useEffect, useState } from "react";

const TenantList = () => {
  const [tenants, setTenants] = useState([]);
  const [loading, setLoading] = useState(true);

  // MySQL Column Order
  const columnOrder = [
    "TenancyContractNumber","PropertyCode","TenantName","TenantDOB","TenantNationality",
    "TenantPassportNumber","TenantEmiratesID","TenantPassportExpiryDate","TenantEIDExpiryDate",
    "TenantEmployer","TenantMobileNumber","TenantEmailID","LeaseStartDate","LeaseEndDate",
    "MoveInDate","MoveOutDate","RentAmount","DepositAmountReceived","NumberOfPayments",
    "RentAmountReceived","RentAmountOutstanding","PassportCopyPath","EIDCopyPath",
    "ResidenceVisaCopyPath","BankStatementCopyPath","DepositChequeCopyPath",
    "SecurityChequeCopyPath","EjariMunicipalRegistrationCopyPath","CreatedBy","CreationDate",
  ];

  const photoFields = [
    "PassportCopyPath","EIDCopyPath","ResidenceVisaCopyPath","BankStatementCopyPath",
    "DepositChequeCopyPath","SecurityChequeCopyPath","EjariMunicipalRegistrationCopyPath",
  ];

  const dateFields = [
    "TenantDOB","TenantPassportExpiryDate","TenantEIDExpiryDate",
    "LeaseStartDate","LeaseEndDate","MoveInDate","MoveOutDate","CreationDate"
  ];

  useEffect(() => {
    fetchTenants();
  }, []);

  const fetchTenants = async () => {
    try {
      setLoading(true);
      const res = await fetch("http://localhost:5000/tenant_list", {
        method: "GET",
        credentials: "include",
      });
      const data = await res.json();
      if (res.ok && data.success) {
        setTenants(data.tenants);
      } else {
        alert(data.message || "Failed to fetch tenants");
      }
    } catch (err) {
      console.error(err);
      alert("Error fetching tenants");
    } finally {
      setLoading(false);
    }
  };

  const handleSort = (key) => {
    const sorted = [...tenants].sort((a, b) => {
      const valA = a[key] ?? "";
      const valB = b[key] ?? "";
      if (!isNaN(valA) && !isNaN(valB)) return valA - valB;
      return valA.toString().localeCompare(valB.toString());
    });
    setTenants(sorted);
  };

  const labelize = (s) =>
    s.replace(/([A-Z])/g, " $1").replace(/_/g, " ").replace(/\b\w/g, (ch) => ch.toUpperCase()).trim();

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: 20, background: "#f0f2f5" }}>
      <h2 style={{ textAlign: "center", background: "#2f3640", color: "white", padding: 15, margin: 0 }}>
        Tenant List
      </h2>

      <div style={{ maxWidth: 1500, margin: "20px auto", background: "white", padding: 20, borderRadius: 10, boxShadow: "0 0 15px rgba(0,0,0,0.2)", overflowX: "auto" }}>
        <div style={{ display: "flex", justifyContent: "space-between", marginBottom: 15 }}>
          <div style={{ fontWeight: "bold" }}>
            {new Date().toLocaleDateString()} | Total Tenants: {tenants.length}
          </div>
          <div>
            <a href="/index" style={{ textDecoration: "none", fontWeight: "bold", color: "#333" }}>‚Üê Go Back Home</a>
          </div>
        </div>

        {loading ? (
          <p>Loading tenants...</p>
        ) : (
          <table style={{ width: "100%", borderCollapse: "collapse" }}>
            <thead>
              <tr>
                {columnOrder.map((col) => (
                  <th
                    key={col}
                    style={{ padding: 8, border: "1px solid #ccc", background: "#273c75", color: "white", cursor: "pointer" }}
                    onClick={() => handleSort(col)}
                  >
                    {labelize(col)}
                  </th>
                ))}
              </tr>
            </thead>

            <tbody>
              {tenants.map((t, idx) => (
                <tr key={idx} style={{ backgroundColor: idx % 2 === 0 ? "#f2f2f2" : "#fff" }}>
                  {columnOrder.map((key) => (
                    <td key={key} style={{ padding: 8, border: "1px solid #ccc", textAlign: "center" }}>
                      {photoFields.includes(key) && t[key] ? (
                        <img src={`data:image/jpeg;base64,${t[key]}`} alt={key} style={{ width: 60, height: 60, borderRadius: 4, border: "1px solid #ccc" }} />
                      ) : dateFields.includes(key) && t[key] ? (
                        t[key].slice(0, 10)
                      ) : (
                        t[key] ?? ""
                      )}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default TenantList;
